import Layout from '../components/Layout'
import Router from 'next/router';

const Custom404 = () => {
    const move = () => {
        Router.push("/")
    }

    return (
        <Layout>
            <h1>404임미당~!@ㅋㅎ</h1>
            <button conClick={move}>이동</button>
        </Layout>
    )
}

export default Custom404;
